import React from "react";
import './Home.css'
export default function(){
  return(
    <>
    <div className="home1">
      <div className="home-sec" id="intro">
        <img className="intro-bg-pic" src="./Images/homebg.jpeg" alt="" />
        <div className="intro-logo">
            <img src="" alt="NITSMUN" />
        </div>

      </div>
      
    </div>
    
    </>
  )
}
